Fantasy DamselsFD - Aug 19, 2012 - Alisha Adams


Mp4 Only


Alisha finds herself in the dark, cold Dungeon, where the only accompaniment she has are the ties that bind her and the chain that keeps her firmly in place. At least she can find some comfort in the fact that she IS alone...That is until the door flies open and she realizes that she has stumbled into a bizarre reality. She soon finds herself cuffed and spread, her struggle to remain futile as she is mercilessly toyed with. All the while, she can do little more than submit...This is a video only update


